import React from 'react';
import './App.css';
import Header from "./components/Header"
import Navigation from "./components/Navigation"
import Main from "./components/Main"
import Contact from "./components/Contact"

function App() {

    return (
        <div>
            <Header />
            <Main />
            <div className="lower-part">
                <Contact />
                <Navigation />
            </div>
        </div>
    );
}

export default App;
